import React, { useState } from 'react';
const Navbar = () => {

  return(
    <nav className='nav'>
      
        <a href="/" className='site-title'>Course Curator</a>
          <ul>
            <li>
              <a href="/courses" className='nav__link'>Solutions</a>
              <a href="/" className='nav__link'>Solutions</a>
            </li>
          </ul>
      </nav>
  );
};

export default Navbar;
